    {
        if (getCommandType() == null) {
            setCommandType(COMMAND_TYPE_MERGE_PATCH);
        }
        if (COMMAND_TYPE_CREATE.equals(getCommandType())) {
            AbstractWorkEffortCommand.SimpleCreateWorkEffort command = new AbstractWorkEffortCommand.SimpleCreateWorkEffort();
            copyTo((AbstractWorkEffortCommand.AbstractCreateWorkEffort) command);
            return command;
        } else if (COMMAND_TYPE_MERGE_PATCH.equals(getCommandType())) {
            AbstractWorkEffortCommand.SimpleMergePatchWorkEffort command = new AbstractWorkEffortCommand.SimpleMergePatchWorkEffort();
            copyTo((AbstractWorkEffortCommand.SimpleMergePatchWorkEffort) command);
            return command;
        } 
        throw new UnsupportedOperationException("Unknown command type:" + getCommandType());
    }


